import React from 'react';
import AttachmentService from '../services/AttachmentServices';
import {Button} from 'react-bootstrap';
import attachment from '../services/AttachmentServices';
import AttachmentComponents from './AttachmentComponents';
class UserComponents extends React.Component{


    constructor(props){
        super(props)
        this.state ={
            users:[]
        }

    }
        componentDidMount(){
                AttachmentService.getAttachment().then(Response) ;{
                    this.setState({users:Response.data})
                };
    }
    render(){
        return(
            <div>
                <navbar bg ="black" variant="dark">
                    <Button variant="outline-info">Search</Button>
                    </navbar>
                <h1 className = "text-center"> My Project</h1>
                <table className = "table table-stripped">
                    <thead>
                        <tr>
                            <th>Barrel</th>
                            <th>Scope</th>
                            <th>Magazine</th>
                            <th>Grip</th>
                        </tr>
                    </thead>

                    <tbody>
                        {
                             this.state.attachments.map(
                                 user =>
                            <tr key = {attachment.id}>
                                <td>{attachment.id}</td>
                                <td>{attachment.Barrel}</td>
                                <td>{attachment.Scope}</td>
                                <td>{attachment.Grip}</td>
                                <td>{attachment.Magazine}</td>
                            </tr>
                             )
                            }   
                     </tbody>

                </table>      
            </div>

        )
    }
}
export default AttachmentComponents
